The following questions are based on the following information.
 The following are the results of a cross between a tall plant with purple flowers and a dwarf plant with red flowers.
 $$
 \begin{array}{lll}
 \text { Tall } & \text { Tall } & \text { Tall } \\
 \text { Purple } & \text { Red } & \text { Purple } \\
 \text { Purple } & \text { Red } & \text { Purple } \\
 \text { Tall } & \text { Red } & \text { Purple }
 \end{array}
 $$

The following questions pertain to the following circuit.
 $$
 \begin{array}{ll}
 \text { Battery voltage } & 12 V \\
 \text { Resistor } & 10 \Omega \\
 \text { Capacitor } & 5 \mu F \\
 \text { Switch } & \text { open }
 \end{array}
 $$
